'use strict';

var SocialNetworkApp = angular
    .module('SocialNetworkApp', ['ngRoute', 'ngResource', 'ngAnimate', 'infinite-scroll', 'rt.popup', 'chieffancypants.loadingBar'])
    .constant({
        'baseServiceUrl': 'http://softuni-social-network.azurewebsites.net/api',
        'PAGE_SIZE': 5,
        'DEFAULT_PROFILE_IMAGE': 'data:image/png;base64,',
        'DEFAULT_COVER_IMAGE': 'data:image/png;base64,'
    })
    .config(function ($routeProvider) {
        $routeProvider
            .when('/', {
                templateUrl: 'templates/home-guest.html',
                controller: 'MainController',
                resolve: {
                    isLogged: function($location) {
                        if(localStorage.getItem('accessToken')) {
                            $location.path('/home');
                        }
                    }
                }
            })
            .when('/home', {
                templateUrl: 'templates/home.html',
                controller: 'MainController',
                resolve: {
                    isNotLogged: function($location) {
                        if(!localStorage.getItem('accessToken')) {
                            $location.path('/');
                        }
                    }
                }
            })
            .when('/user/:username/wall/', {
                templateUrl: 'templates/wall.html',
                controller: 'MainController',
                resolve:{
                    isNotLogged: function($location){
                        if(!localStorage.getItem('accessToken')) {
                            $location.path('/');
                        }
                    }
                }
            })
            .when('/user/:username/friends/', {
                templateUrl: 'templates/friends.html',
                controller: 'MainController',
                resolve: {
                    isNotLogged: function($location){
                        if(!localStorage.getItem('accessToken')) {
                            $location.path('/');
                        }
                    }
                }
            })
            .when('/profile', {
                templateUrl: 'templates/editProfile.html',
                controller: 'ProfileController',
                resolve: {
                    isLogged: function($location) {
                        if(!localStorage.getItem('accessToken')) {
                            $location.path('/');
                        }
                    }
                }
            })
            .when('/profile/password', {
                templateUrl: 'templates/editPassword.html',
                controller: 'ProfileController',
                resolve: {
                    isLogged: function($location) {
                        if(!localStorage.getItem('accessToken')) {
                            $location.path('/');
                        }
                    }
                }
            })
            .when('/login', {
                templateUrl: 'templates/login.html',
                controller: 'AuthenticationController',
                resolve: {
                    isLogged: function($location) {
                        if(localStorage.getItem('accessToken')) {
                            $location.path('/home');
                        }
                    }
                }
            })
            .when('/register', {
                templateUrl: 'templates/register.html',
                controller: 'AuthenticationController',
                resolve: {
                    isLogged: function($location) {
                        if(localStorage.getItem('accessToken')) {
                            $location.path('/home');
                        }
                    }
                }
            })
            .when('/logout', {
                templateUrl: 'templates/logout.html',
                controller: 'AuthenticationController',
                resolve: {
                    isLogged: function($location) {
                        if(!localStorage.getItem('accessToken')) {
                            $location.path('/');
                        }
                    }
                }
            })
            .otherwise({
                redirectTo: '/'
            });
    });